import React, { useEffect, useState } from 'react'
import '../../css/pages/signupsignin.css'
import '../../css/reusables/positions.css'
import axios from 'axios';
import { useNavigate } from 'react-router';

import report from '../reusables/reportGenerator';
import '../../css/pages/admin.css'

function Admin()  {

  const [reportDates, setReportDates] = useState({startDate: '', endDate: '' });
  const [carSales, setCarSales] = useState([]);
  const [cars, setCars]=useState([]);
  const [search, setSearch]=useState([]);
  const [selectedCar, setSelectedCar] = useState(null);
  const [isModalOpen, setIsModalOpen] = useState(false);

  const navigator = useNavigate()

    const changeHandler = (event) => {
    const name = event.target.name;
    const value = event.target.value;
    const tempReportDates = { ...reportDates};
    tempReportDates[name] = value;

    setReportDates(tempReportDates)
    }

    const handleSearchChange = (event) => {
      setSearch(event.target.value);
    };

  const reportSubmitHandler = async() => {

      try {

        const response = await axios.get(`http://localhost:8080/car/findCarsSold/${reportDates.startDate}/${reportDates.endDate}`);
        setCarSales(response.data);
        report(carSales);
      } catch (err) {
        console.log('error');
      }
    };

    const findAllSubmitHandler=() => {

      try {
        axios.get('http://localhost:8080/car/findCarsInInventory')
        .then((response) => {
          setCars(response.data);}
        )}
       catch(err) {
          console.log('error');
       }

    };
    const handleSearchSubmit = (event) => {
      event.preventDefault();

      axios
        .get(`http://localhost:8080/car/findCarByModel/${search}`)
        .then((response) => {
          setCars(response.data);
        })
        .catch((error) => {
          console.log(error);
        });
    };

    const handleCarClick = (car) => {
      setSelectedCar(car);
      setIsModalOpen(true);
    };

    const closeModal = () => {
      setIsModalOpen(false);
    };

    const showCars = () => {
      return cars.map((car) => (
        <div
          className='car-box'
          key={car.id}
          onClick={() => handleCarClick(car)}
        >
          Click To View Details
          <img src={car.carPhotos[0].photoUrl} alt={car.model} />
        </div>
      ));
    };

    const showCarPhotos = (car) => {
      return (
        <div>
          {car.carPhotos.map((photo) => (
            <img src={photo.photoUrl} alt={car.model} key={photo.id} />
          ))}
        </div>
      );
    };






    return (
            <div className= 'fill'>
            <div className='flex-column admin-sidebar justify-content-center'>
                    <h2>Hello Dealer</h2>
                    <h1>Run Sales Report</h1>
                    Report Start Date
                    <input className='sidebar-input-container'  value={reportDates.startDate} name='startDate' type='startDate' onChange={changeHandler} required></input>
                    Report End Date
                    <input className='sidebar-input-container' value={reportDates.endDate} name='endDate' type='endDate' onChange={changeHandler} required></input>
                    <button onClick={reportSubmitHandler}>GET REPORT</button>
                    <h1>EDIT CARS</h1>
                    <h2>Find All</h2>
                    <button onClick={findAllSubmitHandler}>FIND ALL CARS</button>
                    <h2>Find By Model</h2>
                    <input className='sidebar-input-container'  value={search} name='model' type='model' onChange={handleSearchChange} required></input>
                    <button onClick={handleSearchSubmit}>FIND BY MODEL</button>
            </div>
            <div className = 'fill'>
                {showCars()}
                  {isModalOpen && selectedCar && (
                    <div>
                      <div>
                        <button onClick={closeModal}>Close</button>
                      </div>
                      <div>
                        <div>DESCRIPTION: {selectedCar.description}</div>
                        <div>MAKE: {selectedCar.make}</div>
                        <div>MODEL: {selectedCar.model}</div>
                        <div>YEAR: {selectedCar.year}</div>
                        <div>MILES: {selectedCar.miles}</div>
                        <div>DATE ADDED:{selectedCar.dateAdded}</div>
                        <div>PRICE: {selectedCar.price}</div>
                        <div className='car-box'>
                          {showCarPhotos(selectedCar)}
                        </div>
                      </div>
                      {/* <div>
                        <button onClick={() => goToCheckout(selectedCar)}>Checkout</button>
                      </div> */}
                    </div>
                  )}
                      </div>
            </div>         


   )
}



export default Admin
